import React from "react";
import I18n from "i18n-js";
import "../../bundles/i18n/ja.js";
import { Button, Checkbox, Form, Input,Layout, Col, Row  } from 'antd';

class Group extends React.Component {
    render() {
        return (
            <div
            className="site-layout-background"
            style={{ padding: 24, minHeight: 200,background: '#fff' }}
          >
            <Row></Row>
            <Row>
            <Col span={12} offset={6}>
           
             <Form  labelCol={{
        span: 8,
      }}>
        <Form.Item
          label="グループ名:"
          name="groupName"
          rules={[
            {
              required: true,
            },
          ]}
        >
          <Input />
        </Form.Item>
  
        <Form.Item
          label="グループ概要:"
          name="groupDescription"
          rules={[
            {
              required: true,
            },
          ]}
        >
          <Input />
        </Form.Item>
  
        <Form.Item
          wrapperCol={{
            offset: 8,
            span: 16,
          }}
        >
          <Button type="primary" htmlType="submit">
            Submit
          </Button>
        </Form.Item>
      </Form>
        
            </Col>
          </Row>
          </div>
            
        
       );
    }
  }

  export default Group;
